css:
.markmap-node {
  cursor: pointer;
}

.markmap-node-circle {
  fill: #fff;
  stroke-width: 1.5px;
}

.markmap-node-text {
  fill:  #000;
  font: 10px sans-serif;
}

.markmap-link {
  fill: none;
}

.markdown-spinner {
  margin: auto;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px;
  background-position: top center;
  padding-top: 70px;
  text-align: center;
}
.markdown-mindmap {
  overflow: hidden;
  background-color: #fff;
  box-sizing: border-box;
  padding: 5px;
}
.markdown-mindmap.markdown-mindmap-theme-default-dark {
  background-color: #1D1F21;
}
.markdown-mindmap.markdown-mindmap-theme-default-dark svg {
  opacity: 0.5;
}
.markdown-mindmap.markdown-mindmap-theme-default-dark .markmap-node-text {
  fill: #050505;
}
.markdown-mindmap.markdown-mindmap-theme-default-dark .markmap-node-circle {
  fill: #1D1F21;
}
.markdown-mindmap.markdown-mindmap-theme-colorful-dark {
  background-color: #1D1F21;
}
.markdown-mindmap.markdown-mindmap-theme-colorful-dark svg {
  opacity: 0.5;
}
.markdown-mindmap.markdown-mindmap-theme-colorful-dark .markmap-node-text {
  fill: #eee;
}
.markdown-mindmap.markdown-mindmap-theme-colorful-dark .markmap-node-circle {
  fill: #1D1F21;
}
